import React from 'react'
import '../styles/menu.scss';
import addIcon from '../img/addIcon.png';
import heartIcon from '../img/heartIcon.jpeg';
import homeIcon from '../img/homeIcon.png';
import wifiIcon from '../img/wifiIcon.jpeg';

const Menu = () => {
  return (
    <div className="menu">
        <img className="icon" src={homeIcon} art="home" />
        <img className="icon" src={addIcon} art="add" />
        <img className="icon" src={wifiIcon} art="explore" />
        <img className="icon" src={heartIcon} art="notificarion" />
    </div>
  )
}

export default Menu
